<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta content="width=device-width, initial-scale=1.0" name="viewport">
    <title>Under Maintenance</title>
    <meta content="Under Maintenance" name="description">

    <!-- Favicons -->
    <!-- <link href="UnderMaintenance/img/favicon.png" rel="icon" defer> -->

    <!-- Google Fonts -->
    <link href="https://fonts.googleapis.com/css?family=Open+Sans:300,300i,400,400i,600,600i,700,700i|Raleway:300,300i,400,400i,600,600i,700,700i" rel="stylesheet">

    <style>
      
    body {
      margin: 0px;
      font-family: "Open Sans", sans-serif;
      color: #fff;
      /* //background: url("../img/bg.jpg") top center no-repeat; */
      background-size: cover;
      position: relative;
      height: 100vh;
      overflow-y: hidden;
      background: linear-gradient(-45deg,#ac32e4,#7918f2,#4801ff);
    }

h4{
  font-size: 23px;
  margin-top: 0;
    margin-bottom: 0.5rem;
    font-weight: 500;
    line-height: 1.2;
}

.text-center{
  text-align: center;
}
    @media (min-width: 1024px) {
      body {
        background-attachment: fixed;
      }
    }

    a {
      color: #24b7a4;
      text-decoration: none;
    }

    a:hover {
      color: #36d8c3;
      text-decoration: none;
    }

    h1,
    h2,
    h3,
    h4,
    h5,
    h6 {
      font-family: "Raleway", sans-serif;
    }

    #main {
      position: relative;
    }

    .back-to-top {
      position: fixed;
      visibility: hidden;
      opacity: 0;
      right: 15px;
      bottom: 15px;
      z-index: 996;
      background: #24b7a4;
      width: 40px;
      height: 40px;
      border-radius: 50px;
      transition: all 0.4s;
    }

    .back-to-top i {
      font-size: 28px;
      color: #fff;
      line-height: 0;
    }

    .back-to-top:hover {
      background: #2ed6c0;
      color: #fff;
    }

    .back-to-top.active {
      visibility: visible;
      opacity: 1;
    }

    #header {
      position: relative;
      width: 100%;
      padding: 120px 0;
      /* countdown */
    }
    @media only screen and (max-width: 600px) {
      #header {
        padding: 55px 0;
      }
    }
    #header h1 {
      margin: 0 0 10px 0;
      font-size: 48px;
      font-weight: 700;
      line-height: 56px;
      color: #fff;
    }

    #header h2 {
      color: #eee;
      margin-bottom: 40px;
      font-size: 22px;
      margin-top: 0;
    }

    #header .countdown {
      margin-bottom: 80px;
    }

    #header .countdown div {
      text-align: center;
      border: 2px solid rgba(255, 255, 255, 0.8);
      border-radius: 8px;
      margin: 10px 10px;
      width: 100px;
      padding: 15px 0;
    }

    #header .countdown div h3 {
      font-weight: 700;
      font-size: 32px;
      margin-bottom: 15px;
      margin-top: 0;
    }

    #header .countdown div h4 {
      font-size: 16px;
      font-weight: 600;
      margin-top: 0;
    }

    @media (max-width: 575px) {
      #header .countdown div {
        width: 70px;
        padding: 10px 0;
        margin: 10px 8px;
      }

      #header .countdown div h3 {
        font-size: 28px;
        margin-bottom: 10px;
      }

      #header .countdown div h4 {
        font-size: 14px;
        font-weight: 500;
      }
    }

    #header .social-links {
      margin-top: 40px;
    }

    #header .social-links a {
      font-size: 16px;
      color: #fff;
      margin: 0 3px;
      border-radius: 50%;
      width: 48px;
      height: 48px;
      transition: 0.3s;
      border: 1px solid rgba(255, 255, 255, 0.5);
      display: inline-flex;
      align-items: center;
      justify-content: center;
    }

    #header .social-links a i {
      line-height: 0;
    }

    #header .social-links a:hover {
      background: #24b7a4;
      border-color: #24b7a4;
    }

    section {
      padding: 60px 0;
      overflow: hidden;
    }

    #footer {
      background: rgba(38, 55, 69, 0.4);
      padding: 30px 0;
      color: #fff;
      font-size: 14px;
      position: fixed;
      bottom: 0;
      width: 100%;
    }

    #footer .copyright {
      text-align: center;
    }

    #footer .credits {
      padding-top: 10px;
      text-align: center;
      font-size: 13px;
      color: #fff;
    }

    #footer .credits a {
      color: #36d8c3;
    }
    #header{
      display: flex;
      justify-content: center;
      align-items: center;
    }
    .custom-container{
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: column;
    }
    .countdown{
      display: flex;
      justify-content: center;
    }
    </style>

  </head>

    <script>    
    (function() {
      "use strict";
      /// Date Format -- Mar 10, 2023 15:00:00
      var FutureDate = new Date("Jun 23, 2023 20:05:54").getTime();

      const select = (el, all = false) => {
        el = el.trim()
        if (all) {
          return [...document.querySelectorAll(el)]
        } else {
          return document.querySelector(el)
        }
      }
      
      let countdown = select('.countdown');
      const output = countdown.innerHTML;

      const countDownDate = function() {
        const now = new Date().getTime();
        let timeLeft =  FutureDate - now ;
        //let days = Math.floor(timeLeft / (1000 * 60 * 60 * 24));
        let hours = Math.floor((timeLeft % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
        let minutes = Math.floor((timeLeft % (1000 * 60 * 60)) / (1000 * 60));
        let seconds = Math.floor((timeLeft % (1000 * 60)) / 1000);

        countdown.innerHTML = output.replace('%h', hours).replace('%m', minutes).replace('%s', seconds);
      }
      countDownDate();
      setInterval(countDownDate, 1000);
    })()
